    'keywords' => '',
    'content' => '<div class="about-gok w-1200"><div class="main-title"><span class="icon">left</span>ABOUT gokeng<span class="icon">right</span></div><div class="main-txt">33 years only to create a green and efficient environment</div><div class="about-img"><img src="http://gokeng.6pima.cn/upload/201608/1472112141679902.jpg" title="1472112141679902.jpg" alt="6-2.jpg"/></div><div class="txt"><div class="main-title" style="white-space: normal;"><br/></div><div class="txt" style="white-space: normal;"><p>Zhongshan GoKeng Furniture Co., Ltd was established in 1983, Today we have 500,000 square meters production park in Zhongshan city, nearly 5000 employees. Has a number of imported machine from Germany and Italy. Products range to solid wood series, software series, screen series and veneer series and so on.</p><p>Company from its early standing &quot;strict requirements and high standards&quot; concept, has passed: ISO9001: 2008 quality management system certification, ISO14001: 2004 environmental management system certification, iso14025 environmental mark product certification, China top 10 brand, CQC product certification of China environmental protection, international standard product mark certificate, Chinese famous brand, Guangdong famous trademark, Guangdong famous brand, China&#39;s furniture industry ten brands of furniture...</p><p>From the begging, GoKeng has set out to provide our customers with service, value and quality,&nbsp;integrity.&nbsp;</p><p><span style="font-weight: 700;">Service</span></p><p>In our 200,000 square meters warehouse and logistic park, have&nbsp;USD12,000,000 standard stock every day, we can ship out most of our standard orders in 24 hours.<br/></p><p>We spend lots of money on product development, make our distributors and clients competitively on the market.</p><p><span style="font-weight: 700;">Value</span></p><p>We assure 5 years warranty for all our products,&nbsp;</p></div><p style="white-space: normal;"><span style="font-weight: 700;">Quality</span></p><p style="white-space: normal;">Nothing is more important than quality, Thats the reason we maintain our own quality control personnel in every production steps, and we GoKeng are the only one who have&nbsp;</p><p style="white-space: normal;">our own quality testing center in Zhongshan.</p><p style="white-space: normal;"><span style="font-weight: 700;">Integrity</span></p><p style="white-space: normal;">We are very prond of the growth GOKENG has realized since she was established in 1983. So with 34 years insist and , We have more than 2000 loyal distributors and&nbsp;</p><p style="white-space: normal;">showrooms in China now.</p><p><br/></p></div><!--about-gok end--><p><br/></p><!--about-gre start--><div class="about-gre w-1200"><div class=" list-paddingleft-2 dk"><div class="fl"><div class="tit"><p>Green &amp; efficient</p><p><strong>Environmental</strong></p></div><div class="cc"><img src="http://gokeng.6pima.cn/upload/201608/1472112170109386.jpg" title="1472112170109386.jpg" alt="6-5.jpg"/><div class="txt"><div class="t">Business purpose</div><div class="c">Provide with service, quality, integrity, value, win-win cooperation</div></div></div><div class="cc"><img src="http://gokeng.6pima.cn/upload/201608/1472112196582521.jpg" title="1472112196582521.jpg" alt="6-6.jpg"/><div class="txt"><div class="t">management idea</div><div class="c">The pursuit of excellence</div></div></div><div class="cc"><img src="http://gokeng.6pima.cn/upload/201608/1472112170109386.jpg" alt="1472112170109386.jpg"/><div class="txt"><div class="t">Business objectives</div><div class="c">Create famous brand, serve social</div></div></div></div><div class="fr"><p><img src="http://gokeng.6pima.cn/upload/201608/1472112227118449.jpg" title="1472112227118449.jpg" alt="6-3.jpg"/></p></div></div><div class="bg dk list-paddingleft-2"><div class="fr"><div class="ccc"><p><em class="icon-phone"></em>&nbsp;&nbsp;Advisory hotline:400-803-2299</p><p><em class="icon-briefcase"></em>&nbsp;&nbsp;Country view Fax: 0760-87332668</p><p><em class="icon-envelope-alt"></em>&nbsp;&nbsp;Country view mailbox: jtlinson@126.com</p></div></div><div class="fl"><p><img src="http://gokeng.6pima.cn/upload/201608/1472112244842218.jpg" title="1472112244842218.jpg" alt="1472112244842218.jpg" border="0" vspace="0"/></p></div></div></div></div>',
